import "./foodBlock.scss";

const foodBlock = ({ food }) => {
  return (
    <div className="food">
      <div className="food__img">
        <img className="food-image" src={food.src} alt="vvv" />
      </div>
      <div className="food__title">{food.name}</div>

      <div className="food__descriptions">{food.description}</div>

      <div className="food__price">
        33 см / 85 грн <br />
        <br />
        45 см / 160 грн
      </div>

      <div className="button">
        <div className="button-link">замовити</div>
      </div>
    </div>
  );
};

export default foodBlock;
